```python
all_components = cloudpss_substation_Model.getAllComponents()
labels_dict = {}

# 遍历所有元件
for key, component in all_components.items():
    # 忽略以 'edge' 开头的元件
    if not key.startswith('edge'):
        try:
            label = component.label  # 使用 label 属性
            if label in labels_dict:
                labels_dict[label].append(component)
            else:
                labels_dict[label] = [component]
        except AttributeError:
            continue  # 跳过没有 label 属性的元件

# 打印同类元件中 label 相同的元件
for label, components in labels_dict.items():
    if len(components) > 1:  # 如果有相同的 label
        print(f"Label: {label}")
        for comp in components:
            print(f" - Component ID: {comp.id}, Type: {type(comp).__name__}")
